5.02 Negative Covenants . Until (i) the Commitments have been terminated, and (ii) all Obligations (other than contingent indemnification obligations) have been paid in full and are
no longer outstanding, including, without limitation, any L/C Obligations or any other contingent obligations, (i) the Borrower will comply, and will cause compliance by the other Loan Parties other than Holdings, with the following negative
covenants, and (ii) Holdings will comply with Section 5.02(q), unless, in each case of clauses (i) and (ii), the Required Lenders shall otherwise consent in writing. 



(a) Indebtedness . None of the Loan Parties shall create, incur, assume or permit to exist any Indebtedness except for the following (“ Permitted Indebtedness ”): 



(i) Indebtedness of the Loan Parties under the Credit Documents and any documents related to any Lender Bank Products; 







-117- 











(ii) Indebtedness (excluding purchase money Indebtedness and Capital Lease obligations) of the Loan Parties listed in Schedule 5.02(a) and existing on the Closing Date and any
Indebtedness of the Loan Parties under initial or successive refinancings of any Indebtedness permitted by this Section 5.02(a)(ii) ; provided that (A) the principal amount of any such refinancing does not exceed the principal
amount of the Indebtedness being refinanced, except by an amount equal to the unpaid accrued interest and premium thereon plus other reasonable amounts paid, and fees and expenses reasonably incurred, in
connection with such refinancing and by an amount equal to any existing commitments utilized thereunder and (B) the material terms and provisions of any such refinancing (including maturity, redemption, prepayment, default and subordination
provisions), taken as a whole, are no less favorable to the applicable Loan Party and the Lenders than the Indebtedness being refinanced; 



(iii) Indebtedness of the Loan Parties under (x) Lender Rate Contracts and (y) other Rate Contracts entered into in the ordinary course of business with respect to Indebtedness permitted by
the other provisions of this Section 5.02(a) , including, without limitation, pursuant to Section 5.01(k) ; provided that (A) all such Lender Rate Contracts and other Rate Contracts are entered into in connection with bona
fide hedging operations and not for speculation and (B) the aggregate notional principal amount under all such Rate Contracts does not exceed the principal amount of the Indebtedness to which such Rate Contracts relate; 



(iv) Indebtedness of the Borrower or any Subsidiary of the Borrower incurred to finance the acquisition of any fixed or capital assets (whether or not constituting purchase money
indebtedness), including Capital Lease obligations (including any outstanding Closing Date Capital Leases) and any Indebtedness assumed in connection with the acquisition of any such assets or secured by a Lien on any such assets prior to the
acquisition thereof; provided, that (A) such Indebtedness is incurred prior to or within 365 days after such acquisition and (B) the aggregate principal amount of Indebtedness permitted by this clause (iv) shall not exceed $45,000,000 at any one
time outstanding; 



(v) secured or unsecured Indebtedness of Foreign Subsidiaries (for the avoidance of doubt, excluding intercompany debt), in an aggregate principal amount not to exceed $15,000,000 at any
time outstanding; provided that an additional $8,000,000 of Indebtedness may be incurred by any Specified Entity if such Indebtedness is secured solely by cash and Cash Equivalents in China; 



(vi) Indebtedness assumed in connection with any Permitted Acquisition, so long as such Indebtedness was not incurred by the Acquired Person in connection with, or in anticipation or
contemplation of, such person becoming a Loan Party or such acquisition and which Indebtedness is without recourse to any Loan Party or to any of their respective properties or assets other than the Person (or its successors) or the assets to
which such Indebtedness related prior to the time such person became a Subsidiary or the time of such acquisition; provided , that, (A) no Default has occurred and is continuing on the date of, or will result after giving effect to, any
such Permitted Acquisition and assumption of Indebtedness (actually and on a pro forma basis) and (B) both immediately before and after giving effect to such Permitted Acquisition and assumption of Indebtedness, the Total Net Leverage Ratio on a
pro forma basis shall be no greater than the maximum ratio permitted under Section 5.03(a) ( provided that the Total Net Leverage Ratio as of the effective date of such acquisition is calculated on a pro forma basis by using
(1) Consolidated Adjusted EBITDA for the most recently ended Test Period of Borrower, and (2) Funded Indebtedness as of the last day of the most recently ended fiscal quarter of the Borrower for which Financial Statements have been delivered
hereunder, minus any repayments of such Indebtedness made since the last day of such most recently ended fiscal quarter (including simultaneously with the effectiveness of such acquisition), plus any additional Indebtedness
incurred by the Loan Parties since the last day of such most recently ended fiscal quarter (including simultaneously with the effectiveness of such Permitted Acquisition and assumption of Indebtedness)), and (C) both immediately before and after
giving effect to such Permitted Acquisition and assumption of Indebtedness, the Fixed Charge Coverage Ratio on a pro forma basis would be no less than the minimum ratio required under Section 5.03(b) ; 





-118- 





(vii) Indebtedness of the Loan Parties with respect to surety, appeal, indemnity, performance or other similar bonds in the ordinary course of business (including surety or similar bonds
issued in connection with the stay of a proceeding of the type described in Section 6.01(h) ); 



(viii) Indebtedness in the form of Earn-Outs payable in connection with any Permitted Acquisition, which Indebtedness shall be subject to subordination terms reasonably acceptable to the
Administrative Agent; 



(ix) Guaranty Obligations and other Contingent Obligations of any Loan Party in respect of Permitted Indebtedness of any other Loan Party; 



(x) Indebtedness owing to any other Loan Parties, subject to the terms of the Intercompany Subordination Agreement; provided that the Investment constituting such Indebtedness is
permitted by Section 5.02(e)(iii) ; 



(xi) Indebtedness consisting of endorsement of instruments or other payment items for deposit; 



(xii) Indebtedness incurred in respect of credit cards, credit processing services, debit cards, stored value cards (including so-called “procurement cards” or “P-cards”), or cash management
services, in each case, incurred in the ordinary course of business; provided that such Indebtedness shall be unsecured except for Liens permitted by Section 5.02(b)(xiii) ; 



(xiii) Guaranty Obligations (or liabilities as a surety, endorser, accommodation endorser or otherwise) in respect of performance, surety, statutory, appeal or similar obligation otherwise
permitted hereunder incurred in the ordinary course of business but excluding guaranties with respect to any obligations for borrowed money; 



(xiv) Indebtedness composing Investments permitted by Section 5.02(e) ; 



(xv) [**]; 



(xvi) [**]; and 



(xvii) Other unsecured Indebtedness in an aggregate principal amount not to exceed $10,000,000 at any one time outstanding. 





-119- 





(b) Liens . No Loan Party shall create, incur, assume or permit to exist any Lien or Negative Pledge on or with respect to any of its Property (excluding Margin Stock), whether
now owned or hereafter acquired, except for the following (“ Permitted Liens ”): 



(i) Liens in favor of the Administrative Agent or any Lender securing the Obligations and Negative Pledges under the Credit Documents; 



(ii) Liens listed in Schedule 5.02(b) and existing on the Closing Date and any extension, renewal or replacement Liens (covering the same or a lesser scope of Property) in respect
of replacement Indebtedness permitted under Section 5.02(a)(ii) ; provided that any extension, renewal or replacement Lien (A) is limited to the Property covered by the existing Lien and (B) secures Indebtedness which is no greater
in amount, except by an amount equal to unpaid accrued interest and premium thereon plus other reasonable amounts paid, and fees and expenses reasonably incurred, in connection with such refinancing and (C) has material terms (taken as a whole)
no less favorable to the Lenders than the Indebtedness secured by the existing Lien; 



(iii) Liens incurred with respect to property acquired using the proceeds of Indebtedness and Capital Leases (including any outstanding Closing Date Capital Leases) permitted under Section 5.02(a)(iv) ,
and Negative Pledges incurred therewith with respect to such property; 



(iv) Liens for Taxes or other Governmental Charges not at the time delinquent or thereafter payable without penalty or being contested in good faith by appropriate proceedings and have not
proceeded to judgment; provided that adequate reserves for the payment thereof have been established in accordance with GAAP and no Property of any Loan Party is subject to impending risk of loss or forfeiture by reason of nonpayment of
the obligations secured by such Liens; 



(v) statutory Liens, possessory liens of carriers and warehousemen, materialmen Liens, mechanic’s Liens and landlord Liens, in each case arising in the ordinary course of business with
respect to obligations which are not delinquent or are being contested in good faith by appropriate proceedings, provided that, if delinquent, adequate reserves have been set aside with respect thereto in accordance with GAAP and, by
reason of nonpayment, no Property of any Loan Party is subject to a material impending risk of loss or forfeiture; 



(vi) Deposits under workers’ compensation, unemployment insurance and social security laws or to secure the performance of bids, tenders, contracts (other than for the repayment of borrowed
money) or leases, or to secure statutory obligations of surety, appeal or customs bonds or to secure indemnity, performance or other similar bonds in the ordinary course of business; 



(vii) [**]; 



(viii) leases or subleases and licenses or sublicenses granted to others (in the ordinary course of business) not interfering in any material respect with the ordinary conduct of the business
or operations of any Loan Party; 





-120- 





(ix) easements, rights-of-way, utility access, zoning or other restrictions, minor defects, encroachments or irregularities in title and other similar charges or encumbrances not
interfering in any material respect with the ordinary conduct of the business of any Loan Party; 



(x) deposits in the ordinary course of business to secure liabilities to insurance carriers, lessor, utilities and other service providers; 



(xi) bankers liens and rights of setoff or offset with respect to customary depository arrangements entered into in the ordinary course of business; 



(xii) Liens arising (A) by reason of security for surety or appeal bonds in the ordinary course of business of any Loan Party and (B) in connection with judgments, orders, decrees or awards
not giving rise to an Event of Default hereunder or securing an appeal or other surety bond related to any such judgment; 



(xiii) Liens in favor of credit card processors (“ Credit Card Processors ”) pursuant to the agreements with such parties, consisting of (a) Deposit Accounts into which such Credit Card
Processor makes payments and any reserve Deposit Account required to be established by such Credit Card Processor, (b) the transactions executed pursuant to the merchant services agreement with such Credit Card Processor and the proceeds thereof;
(c) the rights of the applicable Person under such merchant services agreement, and (d) other assets in the possession of such Credit Card Processor, provided, that (x) obligations secured by such Liens are incurred by such Persons in the
ordinary course of business for credit card processing services and not in connection with the borrowing of money, (y) such Liens only secure amounts not past due (except to the extent such amounts are being diligently disputed in good faith and
the applicable Credit Card Processor has not exercised any of its rights with respect to the collateral for its obligations, and (z) all Deposit Accounts subject to Liens in favor of the Credit Card Processors are subject to Control Agreements
unless any such Deposit Account is permitted to remain without a Control Agreement pursuant to this Agreement or such Deposit Account is not owned by a Credit Party; 



(xiv) any Lien relating to Indebtedness permitted under Section 5.02(a)(vi) ; provided that: (x) such Lien is not created in contemplation of or in connection with such Permitted
Acquisition or such Person becoming a Loan Party as otherwise permitted hereunder, as the case may be; (y) such Lien shall not apply to any other property or assets of any other Loan Party; and (z) such Lien shall secure only those obligations
which it secures on the date of such Permitted Acquisition or the date such Person becomes a Loan Party, as the case may be; 



(xv) Liens on property of a Foreign Subsidiary securing Indebtedness of the Foreign Subsidiary permitted under Section 5.02(a)(v) ; 



(xvi) in the case of any non-wholly owned Subsidiary of a Loan Party or any joint venture, any customary put and call arrangements or restrictions on disposition related to its Equity
Securities set forth in its organizational documents or any related joint venture or similar agreement; 



(xvii) Liens solely on any cash earnest money deposits made by Loan Party in connection with any letter of intent or purchase agreement with respect to a Permitted Acquisition; 





-121- 





(xviii) (A) any interest of a lessor under any lease that does not constitute Indebtedness and (B) any precautionary Uniform Commercial Code financing statement filed regarding any such lease
permitted under this Agreement; and 



(xix) other Liens (other than any Lien imposed by ERISA) which do not secure Indebtedness for borrowed money or letters of credit and as to which the aggregate amount of the obligations
secured thereby does not exceed $5,000,000; 



provided , however , that the foregoing exceptions shall not permit any Lien on any Equity Securities issued by any Loan Party, except for Liens in favor
of the Administrative Agent securing the Obligations (or any guaranty thereof). 



(c) Asset Dispositions . No Loan Party shall, directly or indirectly, sell, lease, convey, transfer, allocate pursuant to a Plan of Division or otherwise dispose of any of its
Property (via a Sale and Leaseback or otherwise), whether now owned or hereafter acquired, except for the following: 



(i) sales by the Loan Parties of inventory and equipment in the ordinary course of their businesses; 



(ii) sales by the Loan Parties of damaged, worn-out, used, obsolete or surplus equipment in the ordinary course of their businesses for not less than Fair Market Value; 



(iii) sales or other dispositions by any Loan Party of Investments permitted by Section 5.02(e)(ii) for not less than Fair Market Value; provided that no Default shall have
occurred and be continuing and the proceeds of such sale or other disposition are retained as working capital with such Loan Party; 



(iv) (x) sales, (y) except in the case of the Borrower under clause (A) below, allocations pursuant to a Plan of Division or (z) other dispositions of assets and property (A) by the
Borrower to any Guarantor, (B) by any Guarantor to the Borrower, (C) by any Guarantor to another Guarantor, (D) by any Loan Party that is not a Credit Party (other than a Pledged Foreign Subsidiary) to any other Loan Party, and (E) by any Pledged
Foreign Subsidiary to any Credit Party or any other Pledged Foreign Subsidiary; 



(v) so long as no Default shall have occurred and be continuing, the Loan Parties may sell Property (including Equity Securities of any Subsidiary (other than the Specified Entities)) if
(I) the Loan Parties receive consideration at the time of the asset sale at least equal to the Fair Market Value of the assets or Equity Securities issued or sold or otherwise disposed of, and at least 75% of the consideration received in the
assets or Equity Securities sold by the Loan Parties is in the form of cash or Cash Equivalents, provided that all such amounts are applied in accordance with Section 2.06(c) , or (II) such asset sale is in respect of equipment in
connection with Sale and Leasebacks, provided that the proceeds of any such Sale and Leaseback shall be entirely in cash and shall not be less than 100% of the Fair Market Value of the equipment being sold (determined in good faith by the
Borrower); 



(vi) the leasing or subleasing of assets in the ordinary course of business not materially interfering with the conduct of the business of the Loan Parties taken as a whole; 





-122- 





(vii) the sale or discount, in each case without recourse and forgiveness, of accounts receivable arising in the ordinary course of business, but only in connection with the compromise or
collection thereof; 



(viii) the lapse of registered patents, trademarks, and other intellectual property of any Loan Party to the extent not economically desirable in the conduct of their business and so long as
such lapse is not materially adverse to the interests of the Lenders; 



(ix) the contemporaneous exchange of equipment traded for credit towards new equipment so long as such transaction is otherwise permitted by the terms of this Agreement; 



(x) any involuntary loss, damage or destruction of property or any involuntary condemnation, seizure or taking, by the exercise of the power of eminent domain or otherwise, or confiscation
or requisition of use of property; 



(xi) the unwinding of any Rate Contract so long as the termination of such Rate Contract does not result in an Event of Default; 



(xii) any disposition of Investments in Cash Equivalents in an arms-length transaction with a third party for fair market value; 



(xiii) dispositions of the Equity Securities of any Specified Entity held by any Loan Party or all or substantially all of the assets of any Specified Entity, in each case, so long as (i)
such disposition is made in an arm’s length transaction at fair market value, (ii) at the time of such disposition, such Specified Entity is not a Material Foreign Subsidiary, (iii) no Default shall have occurred and be continuing, (iv) the Net
Proceeds therefrom are applied and/or reinvested as (and to the extent) required by Section 2.06(c)(iii) and (v) in the case of an asset disposition, such Specified Entity is promptly merged or consolidated with and into, or dissolved or
liquidated into, a Loan Party in a transaction permitted under Section 5.02(d)(i) ; 



(xiv) transfers permitted by Sections 5.02(b) , 5.02(d) , 5.02(e) , and 5.02(f) ; 



(xv) [**]; 



(xvi) dispositions of assets (other than accounts, intellectual property, licenses, Equity Securities of Loan Parties) not otherwise permitted in clauses (i) through (xv) above so long as
made at fair market value and the aggregate fair market value of all assets disposed of in all such dispositions since the Closing Date would not exceed $2,500,000. 



(d) Mergers, Acquisitions, Etc . No Loan Party shall reorganize, recapitalize or consolidate with or merge into any other Person or permit any other Person to merge into it, or
liquidate or dissolve or permit any of its Subsidiaries to liquidate or dissolve, or acquire any Person as a new Subsidiary or acquire all or substantially all of the assets, or any identifiable business unit or division, of any other Person, or
divide into two or more Persons pursuant to a Plan of Division, except for the following: 





-123- 





(i) (x) the Borrower and the other Loan Parties may merge or consolidate with and into, or be dissolved or liquidated into, each other; provided that (A) no Default shall have
occurred and be continuing or would result after giving effect to any such transaction, (B) the Borrower and Holdings may not merge or consolidate with and into, or be dissolved or liquidated into, each other, (C) in any such transaction
involving the Borrower, the Borrower is the surviving Person, (D) in any such transaction involving Holdings, Holdings is the surviving Person, and (E) in any such transaction involving a Guarantor and another Loan Party (other than the Borrower
or Holdings), a Guarantor is the surviving Person, and (y) any Subsidiary may be divided into two or more Persons pursuant to a Plan of Division (provided that each Person into which such Subsidiary is divided shall already be or become a
Guarantor to the extent required by Section 5.01(i) and the Borrower shall comply with Section 5.01(i) in connection therewith); 



(ii) Acquisitions by a Loan Party of all or substantially all the assets of, or all the Equity Securities of, a Person or an identifiable business unit or a division or line of business of
any other Person (in each case, the “ Proposed Target ”); provided that: 



(A) no Default has occurred and is continuing on the date of, or will result after giving effect to, any such acquisition (actually and on a pro forma basis); 



(B) the Proposed Target is in the same, similar or related line of business in which the Loan Parties are engaged as of the Closing Date; 



(C) the acquisition of the Proposed Target shall be completed as a result of an arm’s length negotiation (i.e. on a non-hostile basis); 



(D) the acquisition of the Proposed Target shall be consummated, in all material respects, in accordance with all applicable Governmental Rules; 



(E) both immediately before and after giving effect to such acquisition, the Total Net Leverage Ratio on a pro forma basis shall be no greater than the maximum ratio permitted under Section 5.03(a) 
( provided that the Total Net Leverage Ratio as of the effective date of such acquisition is calculated on a pro forma basis by using (1) Consolidated Adjusted EBITDA for the most recently ended Test Period of Borrower, and (2) Funded
Indebtedness as of the last day of the most recently ended fiscal quarter of the Borrower for which Financial Statements have been delivered hereunder, minus any repayments of such Indebtedness made since the last day of such most
recently ended fiscal quarter (including simultaneously with the effectiveness of such acquisition), plus any additional Indebtedness incurred by the Loan Parties since the last day of such most recently ended fiscal quarter (including
simultaneously with the effectiveness of such acquisition)), and the Borrower shall deliver to the Administrative Agent a certificate setting forth in reasonable detail the calculations demonstrating such compliance with this condition; 



(F) in the case of an acquisition of assets, the Administrative Agent shall hold a perfected, first priority security interest in and Lien on all of the assets directly or indirectly
acquired by a Credit Party in such transaction (including but not limited to the assets owned by the Proposed Target), subject to any Liens that would otherwise constitute Permitted Liens, 





-124- 





(G) in the case of an acquisition of all the Equity Securities of a Person, if such Proposed Target remains a separate Subsidiary, all action required of such Subsidiary and of the Loan
Parties under Section 5.01(i) shall be completed by the time(s) specified in Section 5.01(i) ; 



(H) if the consideration to be delivered in connection with the proposed acquisition includes any deferred consideration payable to any seller, such as payment under a seller note,
Earn-Outs, or extraordinary payments under consulting, employment or lease agreements with such seller or its Affiliates, such deferred consideration shall in all cases be expressly subordinated to payment of the Obligations pursuant to a Seller
Subordinated Note or a subordination agreement substantially in the form of Exhibit O (or an agreement containing substantially similar terms); 



(I) the aggregate consideration paid (other than with the proceeds of equity) by the Loan Parties for any Permitted Acquisitions in any year shall not exceed (i) $7,500,000, if at the
time of such Permitted Acquisition, the Total Net Leverage Ratio, calculated on a pro forma basis would be greater than 2.50:1.00 or (ii) $10,000,000, if at the time of such Permitted Acquisition, the Total Net Leverage Ratio, calculated on a pro
forma basis would be less than or equal to 2.50:1.00; and 



(J) the Borrower shall deliver to the Administrative Agent a copy of any quality of earnings report (if any) received by the Borrower in connection with any Permitted Acquisition and a
copy of the draft purchase agreement, in each case, at least five (5) days prior to the consummation of such Permitted Acquisition (or such later time as the Administrative Agent may reasonably agree). 



(e) Investments . None of the Loan Parties shall make any Investment except for Investments in the following: 



(i) Investments by the Credit Parties in deposit accounts, securities accounts or commodity accounts, cash and Cash Equivalents, provided that any such Investments of any Credit
Party are, to the extent required by Section 5.02(p) below, subject to a Control Agreement; 



(ii) Investments listed in Schedule 5.02(e) existing on the Closing Date; 



(iii) Investments by the Loan Parties in any other Loan Party (other than Holdings); provided that (a) no such Investment may be made when an Event of Default described in Section 6.01(a),

(f) or (g) has occurred and is continuing, (b) if such Investment constitutes Indebtedness, it shall be evidenced by one or more Pledged Intercompany Notes, which shall be subject to a first priority perfected security interest in favor of
the Administrative Agent and in the Administrative Agent’s possession to the extent required by the Security Documents, (c) the aggregate amount of Investments made in any fiscal year by the Loan Parties in any Loan Party (other than the
Specified Entity) that is not a Credit Party shall not exceed $10,000,000 and (d) no such Investment may be made in any Specified Entity; 





-125- 





(iv) Investments consisting of loans or advances to employees, officers and directors of the Loan Parties (x) for moving and travel expenses, drawing accounts and similar expenditures in
the ordinary course of business, (y) consisting of pay-day advances made in the ordinary course of business and (z) otherwise, in an aggregate principal amount which shall not exceed $2,500,000 in any fiscal year; 



(v) extensions of trade credit to customers of the Loan Parties or Investments arising from transactions by any Loan Party with customers and suppliers, in each case, in the ordinary
course of business; 



(vi) Investments received in connection with the satisfaction or enforcement of Indebtedness or claims due or owing to any Loan party or the settlement of a bona fide dispute with another
Person or as security for such Indebtedness or claims; 



(vii) Investments permitted by Section 5.02(d) , and Guaranty Obligations in respect thereof so long as such Guaranty Obligations are with respect to obligations of a Loan Party
purchaser under the applicable purchase agreement for a Permitted Acquisition and not for obligations constituting Indebtedness; 



(viii) Investments in negotiable instruments deposited or to be deposited for collection in the ordinary course of business; 



(ix) advances made in connection with purchases of goods or services in the ordinary course of business; 



(x) the formation of any direct or indirect Subsidiary so long as the requirements of Section 5.01(i) are met, for the avoidance of doubt, all subject to Section 5.02(e)(iii) ; 



(xi) Investments made for the benefit of employees of any Loan Party for the purposes of deferred compensation; 



(xii) Investments that constitute Indebtedness permitted by Section 5.02(a) , for the avoidance of doubt, in the case of Investments by the Loan Parties in each other, all subject to Section 5.02(e)(iii) ; 



(xiii) Investments consisting of repayments or other acquisitions of Indebtedness of any Loan Party that are expressly permitted by Section 5.02(h) ; and 



(xiv) Other Investments not exceeding $15,000,000 in the aggregate in any fiscal year (with no carryover to succeeding years); 



For purposes of this Section 5.02(e) , the amount of any Investment shall be the amount actually invested, without adjustment for subsequent increases or decreases in the value of such Investment (including
any write-downs or write-offs thereof) but giving effect to any cash returns or cash distributions received by such Person with respect thereto in an amount not to exceed the original amount of such Investment. 



(f) Restricted Payments . No Loan Party shall make any Restricted Payment or set apart any sum for any such purpose except as follows: 





-126- 





(i) any Subsidiary may make Restricted Payments on its Equity Securities to Holdings or any intervening Subsidiary; provided that any Subsidiary that is a Credit Party may only make
Restricted Payments to another Credit Party (other than Holdings); 



(ii) Holdings may declare and make other Restricted Payments with respect to its Equity Securities payable solely in shares of Equity Securities (other than Disqualified Securities); 



(iii) the Credit Parties may make Restricted Payments so long as: (A) no Default would exist after giving effect to any such Restricted Payment, (B) the Total Net Leverage Ratio on a pro
forma basis would be no greater than the maximum ratio permitted under Section 5.03(a) after giving effect to such Restricted Payment ( provided that the Total Net Leverage Ratio as of such day is calculated on a pro forma basis by
using (1) Consolidated Adjusted EBITDA for the most recently ended Test Period of Borrower and (2) Funded Indebtedness as of the last day of the most recently ended fiscal quarter of the Borrower for which Financial Statements have been delivered
hereunder, minus any repayments of such Indebtedness made since the last day of such most recently ended fiscal quarter (including simultaneously with the effectiveness of such Restricted Payment), plus any additional Indebtedness
incurred by the Loan Parties since the last day of such most recently ended fiscal quarter (including simultaneously with the effectiveness of such Restricted Payment)), (C) the Fixed Charge Coverage Ratio on a pro forma basis would be no less
than the minimum ratio required under Section 5.03(b) after giving effect to such Restricted Payment, and (D) the aggregate amount of all such Restricted Payments under this Section 5.02(f)(iii) shall not exceed in any fiscal year
(i) $4,000,000, if at the time of such Restricted Payment, the Total Net Leverage Ratio, calculated on a pro forma basis would be greater than 3.00:1.00 or (ii) $10,000,000, if at the time of such Restricted Payment, the Total Net Leverage Ratio,
calculated on a pro forma basis would be less than or equal to 3.00:1.00. 



(g) Change in Business . No Loan Party shall engage, either directly or indirectly through Affiliates, in any business different from the business of the Loan Parties as of the
Closing Date, any reasonable extensions thereof and any business reasonably related to, necessary for, in support or anticipation of, ancillary or complementary to or in preparation for any such business except for transactions permitted by Section 5.02(d) 
and Section 5.02(e) . 



(h) Payments of Subordinated Obligations . No Loan Party shall: 



(i) pay or prepay any principal, premium, interest or any other amount (including sinking fund payments) with respect to any Subordinated Obligation (except the Loan Parties may make
required payments with respect to Earn-Outs so long as no Event of Default has occurred and is then continuing), or redeem purchase, defease, acquire or otherwise satisfy (or offer to redeem, purchase, acquire or otherwise satisfy) any
Subordinated Obligations (except the Loan Parties may make required payments with respect to Earn-Outs so long as no Event of Default has occurred and is then continuing); or make any payment or deposit any monies, securities or other property
with any trustee or other Person that has the effect of providing for the satisfaction (or assurance of any satisfaction) of any Subordinated Obligations prior to the date when due or otherwise to provide for the defeasance of any Subordinated
Obligations, except, in each case, to the extent permitted by the subordination and similar terms governing such Subordinated Obligations; or 





-127- 





(ii) directly or indirectly, supplement, modify, amend, restate, extend or otherwise change the terms of any document, instrument or agreement evidencing or governing any Subordinated
Obligations except, in each case, to the extent permitted by the subordination and similar terms governing such Subordinated Obligations. 



(i) ERISA . 



(i) No Loan Party or any ERISA Affiliate shall (A) adopt or institute any Employee Benefit Plan or begin contributing to, or incur any obligation to contribute to, any Multiemployer
Plan; (B) take any action which will result in the partial or complete withdrawal, within the meanings of Sections 4203 and 4205 of ERISA, from a Multiemployer Plan; (C) engage or permit any Person to engage in any transaction prohibited by
Section 406 of ERISA or Section 4975 of the IRC involving any Employee Benefit Plan or Multiemployer Plan which would subject a Loan Party or any ERISA Affiliate to any tax, penalty or other liability including a liability to indemnify; (D) incur
or allow to exist any accumulated funding deficiency (within the meaning of Section 412 of the IRC or Section 302 of ERISA); (E) fail to make full payment when due of all amounts due as contributions to any Employee Benefit Plan or Multiemployer
Plan; (F) fail to comply with the requirements of Section 4980B of the IRC or Part 6 of Title I(B) of ERISA or any similar applicable state law; or (G) adopt any amendment to any Pension Plan which would require the posting of security pursuant
to Section 401(a)(29) of the IRC. 



(ii) No Loan Party shall (A) engage in any transaction prohibited by any Governmental Rule applicable to any Foreign Plan; (B) fail to make full payment when due of all amounts due as
contributions to any Foreign Plan; or (C) otherwise fail to comply with the requirements of any Governmental Rule applicable to any Foreign Plan. 



(j) Transactions With Affiliates . No Loan Party shall enter into or permit to exist any Contractual Obligation with any Affiliate or engage in any other transaction with any
